css:
.sheet-toolbar .btn-toolbar img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar-container {
  background-image: -webkit-linear-gradient(top, #41403b, #34332f);
  box-shadow: none;
}
.sheet-toolbar-container .btn {
  background: #4c4b45;
}
.sheet-toolbar-container .btn.btn-toolbar {
  color: #f6f6f6;
}
.sheet-toolbar-container .toolbar-activity .activity-toolbar-icon {
  background: #f6f6f6;
}
.sheet-toolbar .item-back img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar .item-back .item-back-title {
  color: #f6f6f6;
}
.sheet-toolbar .selection-bar .absolute {
  border-color: #4e4d47;
  background-color: #2c2b28;
}
.sheet-toolbar .selection-bar .absolute .inner .centered {
  color: #f6f6f6;
}
.btn-icon img.content-mask {
  background-color: #f6f6f6;
  color: #f6f6f6;
}
.btn-icon img.content-mask:hover {
  background-color: #f07746;
}
.fixed-popover .thread-sharing-popover {
  position: relative;
  width: 265px;
}
.fixed-popover .thread-sharing-popover .share-toggle {
  padding: 7px 10px;
}
.fixed-popover .thread-sharing-popover .share-toggle input {
  margin-right: 7px;
}
.fixed-popover .thread-sharing-popover .share-input {
  border-top: 2px solid rgba(0, 0, 0, 0.15);
  padding: 10px 5px 0 5px;
}
.fixed-popover .thread-sharing-popover .share-input input[type="text"] {
  cursor: default;
  -webkit-user-select: all;
}
.fixed-popover .thread-sharing-popover .share-controls {
  text-align: center;
  padding: 10px;
}
.fixed-popover .thread-sharing-popover .share-controls .share-message {
  color: rgba(35, 31, 32, 0.5);
  margin-bottom: 10px;
  font-size: 12.04px;
}
.fixed-popover .thread-sharing-popover .share-controls button.btn + button.btn {
  margin-left: 10px;
}
.fixed-popover .thread-sharing-popover.disabled .share-input input[type="text"] {
  color: rgba(35, 31, 32, 0.5);
  -webkit-user-select: none;
}
.fixed-popover .thread-sharing-popover.disabled button.btn {
  color: rgba(35, 31, 32, 0.5);
}
